import React from 'react';
import '../css/navbar.css'

function ExlporeDropdown(){
    return (
        <div>
            Explore
            <ul>
                <li>Stacks</li>
                <li>Queues</li>
                <li>Graphs</li>
                <li>Binary Trees</li>
            </ul>
        </div>
    )
}

export default ExlporeDropdown;
